function DrawingTool() {
  const icons = [
    { icon: faPencil, label: "Pencil" },
    { icon: faEraser, label: "Eraser" },
    { icon: faFill, label: "Fill" },
    { icon: faArrowLeft, label: "Undo" },
    { icon: faArrowRight, label: "Redo" },
  ];

  return (  
    <div className="rounded-xl border grid grid-cols-[24px_420px_24px_1fr_24px] items-center py-4">
      <div></div>
      <div className="bg-gray-100 w-full h-full"></div>
    </div>
  );
}

export default DrawingTool;
